import { Box, SxProps, Theme, Typography, TextField } from "@mui/material";

export const Main = () => {
    return (
        <Box className="Main" sx={sx}>
            <Box className="LoginBox">
                <Typography className="LoginText" variant="h3">Login</Typography>
                <Box className="TextBox">
                    <TextField></TextField>
                </Box>
            </Box>
        </Box>
    );
};

// クラス名に対するスタイルを定義
const sx: SxProps<Theme> = {
    "&.Main": {
        width: "100%",
    },
    ".LoginBox": {
        top: "100px",
        width: "500px",
        height: "600px",
        margin: "auto",
        backgroundColor: "#999999",
    },
    ".LoginText": {
        textAlign: "center",
        color: "#FFF",
    },
    ".TextBox": {
        textAlign: "center",
    }
};
